import React from 'react'
class Users extends React.Component {
  render() {
    return (
      <div>
        <h1>test</h1>
        <footer className="Main-footer">
      <Link to="/"><img src={home} className="Main-footer" alt="Home" /></Link>
      </footer>
      </div>
    )
  } 
}
export default Users
